import { registerDynImportEntry } from 'js/moduleLoader';
registerDynImportEntry('js/sessionManager.service', () => import('js/sessionManager.service'));
registerDynImportEntry('viewmodel/CommonRootViewModel', () => import('viewmodel/CommonRootViewModel'));
registerDynImportEntry('viewmodel/AwErrorSublocationViewModel', () => import('viewmodel/AwErrorSublocationViewModel'));;
export default {
    "root": {
        "abstract": true,
        "view": "CommonRoot"
    },
    "errorLocation": {
        "data": {
            "browserSubTitle": {
                "source": "/i18n/UIMessages",
                "key": "MissingPageTitle"
            },
            "headerTitle": {
                "source": "/i18n/UIMessages",
                "key": "MissingPageTitle"
            }
        },
        "type": "location"
    },
    "errorSubLocation": {
        "data": {
            "priority": 0,
            "label": ""
        },
        "parent": "errorLocation",
        "view": "AwErrorSublocation",
        "url": null
    },
    "internalOAuth2State": {
        "url": "/access_token={accessToken}",
        "resolveActions": {
            "authentication": {
                "actionType": "JSFunction",
                "method": "authenticationSuccessful",
                "deps": "js/sessionManager.service"
            }
        }
    }
};
